import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import logo from './components/icons/logo.jpeg';
import './App.css';
import Navigation from './components/navigation';

const Home = () => <h1>Home Page</h1>;
const EntryExit = () => <h1>Entry/Exit Page</h1>;
const Profile = () => <h1>Profile Page</h1>;
const Logout = () => <h1>Log Out Page</h1>;

class GateEntryManagementSystem extends React.Component {
  render() {
    return (
      <Router>
        <div className="container">
          <header className="header">
            <img src={logo} alt="logo" className="logo" />
            <h1>Gate Entry Management System - GEMS</h1>
          </header>

          {/* Reusable Navigation Component */}
          <Navigation />

          {/* Page Content */}
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/entry-exit" element={<EntryExit />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/logout" element={<Logout />} />
          </Routes>

          {/* Additional components like filter and table can go on specific pages */}
          <section className="filter-section">
            <label>
              Name:
              <input type="text" />
            </label>
            <label>
              Roll No:
              <input type="text" />
            </label>
            <label>
              Category:
              <input type="text" />
            </label>
            <label>
              Date of Arrival:
              <input type="text" />
            </label>
          </section>

          <table className="table">
            <thead>
              <tr>
                <th>Name</th>
                <th>Roll No</th>
                <th>Category</th>
                <th>Date and Time of Arrival</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Agastya Nath</td>
                <td>12340140</td>
                <td>Student</td>
                <td>12/11/2024, 11:30 AM</td>
              </tr>
              {/* Additional rows can be added here */}
            </tbody>
          </table>
        </div>
      </Router>
    );
  }
}

export default GateEntryManagementSystem;

ReactDOM.render(<GateEntryManagementSystem />, document.getElementById('root'));
